import './App.css';
import { Route, Routes } from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <Routes>
            <Route path="/" element={<Converter />}/>
            <Route path="average" element={<Average />}/>
      </Routes>
    </div>
  );
}

export default App;
